l lamb. What about those of us who knew better? We who knew the words were lies and worse than lies? Why did we sit silent? Why did we take part? Because we loved our country! What difference does it make if a few political extremists lose their rights? What difference does it make if a few racial minorities lose their rights? It is only a passing phase. It is only a stage we are going through. It will be discarded sooner or later. Hitler himself will be discarded... sooner or later. The country is in danger. We will march out of the shadows. We will go forward. Forward is the great password. And history tells how well we succeeded, your honor. We succeeded beyond our wildest dreams. The very elements of hate and power about Hitler that mesmerized Germany, mesmerized the world! We found ourselves with sudden powerful allies. Things that had been denied to us as a democracy were open to us now. The world said logseq____&apos;go ahead, take it, take it! Take Sudetenland, take the Rhineland - remilitarize it - take all of Austria, take it! And then one day we looked around and found that we were in an even more terrible danger. The ritual began in this courtroom swept over the land like a raging, roaring disease. What was going to be a passing phase had become the way of life. Your honor, I was content to sit silent during this trial. I was content to tend my roses. I was even content to let counsel try to save my name, until I realized that in order to save it, he would have to raise the specter again. You have seen him do it - he has done it here in this courtroom. He has suggested that the Third Reich worked for the benefit of people. He has suggested that we sterilized men for the welfare of the country. He has suggested that perhaps the old Jew did sleep with the sixteen year old girl, after all. Once more it is being done for love of country. It is not easy to tell the truth; but if there is to be any salvation for Germany, we who know our guilt must admit it...  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
